/* Fortest1.js*/
import React , {useState} from "react";

function Fortest1(props){
    const [fruitList] = useState(["사과","배","포도","수박","머루"]);


    return(
        <div>
            <ul>{
            fruitList.map
            ((item, index) =>{
                return(
                   
                    <li key={index} >
               
                    </li>

                );



            })
}
</ul>
        </div>
    )
}

export default Fortest1;
